import React, { useState, useEffect } from 'react'
import { useHistory } from 'react-router-dom'
import axios from 'axios'


export default function Login(){
   const history = useHistory()
   const [state, SetState] = useState({
       email: '',
       password: ''
   })

   const handleSubmit = async (e) => {
       e.preventDefault()

      await axios.get('/login').then(res => {
        console.log(res);

    })

   }

    return (
        <div className="home-page-register">
        <form className="form">
           <label>Email</label>
           <input type="text" placeholder="john@gmail.com" value={state.email} onChange={(e)=> SetState.email(e.target.value)}/>
           <label>Password</label>
           <input type="password" placeholder="Password" value={state.password} onChange={(e) => SetState.password(e.target.value)}/>
           <button onClick={(e) => handleSubmit(e)} >login</button>
        </form>
    </div>
    )
}
